          duration: .5,
          ease: "bounce",
          delay: 0.8,
          scrollTrigger: {
            trigger: ".content3",
          },
        },
        {
          x: 0,
          opacity: 1,
          duration: .5,
          ease: "bounce",
          delay: 1,
          scrollTrigger: {
            trigger: ".content3",
          },
        }
      );


      gsap.fromTo(
        ".content6",
        {
          x: 100,
          opacity: 0,
          duration: .5,
          ease: "bounce",
          delay: 0.8,
          scrollTrigger: {
            trigger: ".content6",
          },
        },
        {
          x: 0,
          opacity: 1,
          duration: .5,
          ease: "bounce",
          delay: 1,
          scrollTrigger: {
            trigger: ".content6",
          },
        }
      );


      gsap.fromTo(
        ".content7",
        {
          x: -100,
          opacity: 0,
          duration: .5,
          ease: "bounce",
          delay: 0.8,
          scrollTrigger: {
            trigger: ".content7",
          },
        },
        {
          x: 0,
          opacity: 1,
          duration: .5,
          ease: "bounce",
