          },
        }
      );


      gsap.fromTo(
        ".content8",
        {
          x: 100,
          opacity: 0,
          duration: .5,
          ease: "bounce",
          delay: 0.8,
          scrollTrigger: {
            trigger: ".content8",
          },
        },
        {
          x: 0,
          opacity: 1,
          duration: .5,
